import React from "react";
import { PresentationContainer } from "./PresentationLayout.style.ts";

function PresentationLayout() {
  return (
    <>
      <MainLayoutContainer>
        <h1>Welcome</h1>
        <h2>I am Ryad Laouedj</h2>
        <h3>Creative developer and student at 42 Paris</h3>
      </MainLayoutContainer>
    </>
  );
}

export default PresentationLayout;
